import React from 'react';
// import Profile from '../../static/images/profile.png';
import style from './styles.scss';

export default function About() {
  return (
    <div className={style.About}>
      <h2>About Me</h2>
      <img className={style.Profile} src='../../static/images/profile.png' />
      <p>
        <strong>
          Hey, I'm Will, a front end developer based in London, UK.
        </strong>
      </p>
      <p>
        Born in South Australia, I graduated from The University of Adelaide
        with a Bachelor of Design Studies and have since grown an interest in
        both UX design and front end development. Having now worked in both of
        these fields for a number of years, I have extensive experience working
        in multi-functional, agile team environments with a primary focus on
        eCommerce solutions.
      </p>
    </div>
  );
}
